import React, { useState } from "react";

const App = () => {
  const [list, setList] = useState({
    id: 0,
    title: "",
    todo: "",
    isDone: false,
  });

  return (
    <div className="App">
      <div className="top">
        <span>My Todo List</span>
        <span>React</span>
      </div>
      <div>
        <label htmlFor="title">제목</label>
        <input id="title" placeholder="제목을 입력하세요"></input>
        <label htmlFor="todo"></label>
        <input id="todo" placeholder="내용을 입력하세요"></input>
        <button>추가하기</button>
      </div>
    </div>
  );
};

export default App;
